INSERT INTO `bot_responses` (`id`, `keyword`, `response`, `category`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'pricing', 'Our bus rental pricing varies based on several factors: bus type, duration, distance, and season. Standard buses start at Ôé▒8,000 per day, luxury coaches at Ôé▒12,000 per day. For accurate pricing based on your specific needs, please provide: pickup/drop-off locations, dates, number of passengers, and trip duration.', 'pricing', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(2, 'rates', 'Our bus rental pricing varies based on several factors: bus type, duration, distance, and season. Standard buses start at Ôé▒8,000 per day, luxury coaches at Ôé▒12,000 per day. For accurate pricing based on your specific needs, please provide: pickup/drop-off locations, dates, number of passengers, and trip duration.', 'pricing', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(3, 'cost', 'Our bus rental pricing varies based on several factors: bus type, duration, distance, and season. Standard buses start at Ôé▒8,000 per day, luxury coaches at Ôé▒12,000 per day. For accurate pricing based on your specific needs, please provide: pickup/drop-off locations, dates, number of passengers, and trip duration.', 'pricing', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(4, 'booking', 'To make a bus rental booking with KingLang: 1) Create an account or log in, 2) Fill out our booking request form with your travel details, 3) Wait for admin approval and pricing, 4) Complete payment to confirm your booking. You can also call us directly for immediate assistance. All bookings require advance notice of at least 24 hours.', 'booking', 1, '2025-08-12 07:04:41', '2025-08-20 07:37:31'),
(5, 'reserve', 'To make a bus rental booking with KingLang: 1) Create an account or log in, 2) Fill out our booking request form with your travel details, 3) Wait for admin approval and pricing, 4) Complete payment to confirm your booking. You can also call us directly for immediate assistance. All bookings require advance notice of at least 24 hours.', 'booking', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(7, 'cancellation', 'Our cancellation policy: Full refund if cancelled 7+ days before departure; 50% refund if cancelled 3-6 days before; 25% refund if cancelled 1-2 days before; No refund for same-day cancellations or no-shows. Refunds are processed within 7-14 business days. Emergency cancellations due to weather or unforeseen circumstances may be handled on a case-by-case basis.', 'policy', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(8, 'cancel', 'Our cancellation policy: Full refund if cancelled 7+ days before departure; 50% refund if cancelled 3-6 days before; 25% refund if cancelled 1-2 days before; No refund for same-day cancellations or no-shows. Refunds are processed within 7-14 business days. Emergency cancellations due to weather or unforeseen circumstances may be handled on a case-by-case basis.', 'policy', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(9, 'refund', 'Our cancellation policy: Full refund if cancelled 7+ days before departure; 50% refund if cancelled 3-6 days before; 25% refund if cancelled 1-2 days before; No refund for same-day cancellations or no-shows. Refunds are processed within 7-14 business days. Emergency cancellations due to weather or unforeseen circumstances may be handled on a case-by-case basis.', 'policy', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(11, 'phone', 'You can reach KingLang Bus Rental through: Phone: [Your phone number], Email: [Your email], Office Hours: Monday-Sunday, 8AM-6PM. For existing bookings, you can also check your booking status and communicate through your account dashboard. For emergencies during travel, we provide 24/7 support.', 'contact', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(12, 'email', 'You can reach KingLang Bus Rental through: Phone: [Your phone number], Email: [Your email], Office Hours: Monday-Sunday, 8AM-6PM. For existing bookings, you can also check your booking status and communicate through your account dashboard. For emergencies during travel, we provide 24/7 support.', 'contact', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(13, 'fleet', 'KingLang offers various bus types: Standard buses (45-50 passengers), Luxury coaches (40-45 passengers with AC, reclining seats, entertainment), Mini buses (20-25 passengers), and Coaster buses (15-20 passengers). All vehicles are regularly maintained, insured, and operated by professional licensed drivers. We can accommodate groups of all sizes for various occasions.', 'fleet', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(14, 'buses', 'KingLang offers various bus types: Standard buses (45-50 passengers), Luxury coaches (40-45 passengers with AC, reclining seats, entertainment), Mini buses (20-25 passengers), and Coaster buses (15-20 passengers). All vehicles are regularly maintained, insured, and operated by professional licensed drivers. We can accommodate groups of all sizes for various occasions.', 'fleet', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(15, 'vehicles', 'KingLang offers various bus types: Standard buses (45-50 passengers), Luxury coaches (40-45 passengers with AC, reclining seats, entertainment), Mini buses (20-25 passengers), and Coaster buses (15-20 passengers). All vehicles are regularly maintained, insured, and operated by professional licensed drivers. We can accommodate groups of all sizes for various occasions.', 'fleet', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(16, 'payment', 'We accept various payment methods: Bank transfer, GCash, PayMaya, and cash payments at our office. A 50% down payment is required to secure your booking, with the remaining balance due before departure. Payment receipts and official receipts are provided for all transactions. We use secure payment processing for online transactions.', 'payment', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(17, 'pay', 'We accept various payment methods: Bank transfer, GCash, PayMaya, and cash payments at our office. A 50% down payment is required to secure your booking, with the remaining balance due before departure. Payment receipts and official receipts are provided for all transactions. We use secure payment processing for online transactions.', 'payment', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(18, 'gcash', 'We accept various payment methods: Bank transfer, GCash, PayMaya, and cash payments at our office. A 50% down payment is required to secure your booking, with the remaining balance due before departure. Payment receipts and official receipts are provided for all transactions. We use secure payment processing for online transactions.', 'payment', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(19, 'requirements', 'For bus rental bookings, we require: Valid ID of the primary contact person, Complete passenger manifest (for insurance purposes), Advance payment (50% down payment), Signed rental agreement. For corporate bookings, additional requirements may include company registration documents. All requirements help ensure safe and legal transportation services.', 'requirements', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(20, 'documents', 'For bus rental bookings, we require: Valid ID of the primary contact person, Complete passenger manifest (for insurance purposes), Advance payment (50% down payment), Signed rental agreement. For corporate bookings, additional requirements may include company registration documents. All requirements help ensure safe and legal transportation services.', 'requirements', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(21, 'safety', 'Safety is our top priority at KingLang. All our buses undergo regular maintenance and safety inspections, our drivers are licensed and experienced professionals, vehicles are equipped with safety features like seatbelts and first aid kits, and we maintain comprehensive insurance coverage. We follow all DOTr regulations and safety protocols for passenger transportation.', 'safety', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(22, 'insurance', 'All KingLang vehicles are covered by comprehensive insurance including passenger accident insurance. This covers medical expenses and other benefits in case of accidents during the trip. We are also registered with relevant government agencies and comply with all transportation safety regulations. Your safety and security are our primary concerns.', 'safety', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(23, 'hours', 'KingLang Bus Rental operates Monday through Sunday, 8AM-6PM for bookings and inquiries. Our buses are available for rental 24/7 depending on your needs and driver availability. For after-hours emergencies or urgent bookings, please call our emergency contact number. We recommend booking in advance to ensure vehicle and driver availability.', 'schedule', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(24, 'schedule', 'KingLang Bus Rental operates Monday through Sunday, 8AM-6PM for bookings and inquiries. Our buses are available for rental 24/7 depending on your needs and driver availability. For after-hours emergencies or urgent bookings, please call our emergency contact number. We recommend booking in advance to ensure vehicle and driver availability.', 'schedule', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(25, 'destinations', 'KingLang serves various destinations across Luzon and nearby areas. We handle local city tours, provincial trips, airport transfers, corporate events, school field trips, and special occasions. Popular destinations include Baguio, Bataan, Subic, La Union, and Metro Manila areas. For destinations outside our regular service area, please inquire for special arrangements.', 'destinations', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(26, 'locations', 'KingLang serves various destinations across Luzon and nearby areas. We handle local city tours, provincial trips, airport transfers, corporate events, school field trips, and special occasions. Popular destinations include Baguio, Bataan, Subic, La Union, and Metro Manila areas. For destinations outside our regular service area, please inquire for special arrangements.', 'destinations', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(27, 'driver', 'All KingLang drivers are licensed professionals with clean driving records and extensive experience in passenger transportation. They undergo regular training and health checks. Our drivers are courteous, punctual, and knowledgeable about routes and destinations. Driver assignments are made based on route familiarity and vehicle type. Professional driver service is included in all rentals.', 'drivers', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41'),
(28, 'drivers', 'All KingLang drivers are licensed professionals with clean driving records and extensive experience in passenger transportation. They undergo regular training and health checks. Our drivers are courteous, punctual, and knowledgeable about routes and destinations. Driver assignments are made based on route familiarity and vehicle type. Professional driver service is included in all rentals.', 'drivers', 1, '2025-08-12 07:04:41', '2025-08-12 07:04:41');
