INSERT INTO `chat_bot_responses` (`id`, `question_pattern`, `response`, `category`, `priority`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'pricing|rates|cost|price|how much|fees', 'Our bus rental rates vary depending on the distance, duration, and type of bus you need. We offer competitive pricing with no hidden fees. For a detailed quote, please use our booking form or contact us directly at 1-800-BUS-RENT.', 'pricing', 10, 1, '2025-08-12 05:19:30', '2025-08-12 05:19:30'),
(2, 'booking|reserve|book|schedule', 'To make a booking, you can use our online booking form by clicking on \"Book a Trip\" in the menu. You\'ll need to provide your pickup location, destination, date, and passenger count. Our team will review your request and get back to you with confirmation.', 'booking', 10, 1, '2025-08-12 05:19:30', '2025-08-12 05:19:30'),
(3, 'cancellation|cancel|refund', 'Our cancellation policy allows for free cancellation up to 48 hours before your scheduled trip. Cancellations made within 48 hours may be subject to a cancellation fee. For full details, please refer to our terms and conditions or contact our support team.', 'policy', 8, 1, '2025-08-12 05:19:30', '2025-08-12 05:19:30'),
(4, 'contact|phone|email|reach|support', 'You can contact us through multiple ways: Phone: 1-800-BUS-RENT, Email: test1@yourbusiness.com, or through this chat system. Our support team is available 24/7 to assist you with any questions or concerns.', 'contact', 9, 1, '2025-08-12 05:19:30', '2025-08-12 05:19:30'),
(5, 'fleet|buses|types|vehicles', 'We maintain a modern fleet of well-maintained buses with professional drivers. Our fleet includes various sizes to accommodate different group sizes and needs. All our buses are regularly inspected and equipped with safety features for your comfort and security.', 'fleet', 7, 1, '2025-08-12 05:19:30', '2025-08-12 05:19:30'),
(6, 'safety|insurance|license', 'Safety is our top priority. All our buses are regularly maintained and inspected. Our drivers are licensed professionals with clean driving records. We carry comprehensive insurance coverage for all our vehicles and passengers.', 'safety', 8, 1, '2025-08-12 05:19:30', '2025-08-12 05:19:30'),
(7, 'payment|pay|methods', 'We accept various payment methods including cash, bank transfer, and online payments through PayMongo (GCash, credit/debit cards). Payment terms and schedules will be discussed during the booking confirmation process.', 'payment', 6, 1, '2025-08-12 05:19:30', '2025-08-12 05:19:30');
