INSERT INTO `chat_messages` (`id`, `conversation_id`, `sender_type`, `message`, `sent_at`, `is_read`) VALUES
(1, 1, 'bot', 'Hello Jeric Ken Verano! I\'m here to help you with your bus rental needs. How can I assist you today?', '2025-08-12 04:40:39', 0),
(2, 1, 'client', 'How do I make a booking?', '2025-08-12 04:41:09', 0),
(3, 1, 'bot', 'To book a bus, you can: 1) Call our reservation line at 1-800-BUS-RENT, 2) Fill out the booking form on our website, or 3) Email your requirements to bookings@busrental.com. We need details like date, time, number of passengers, pickup/dropoff locations, and any special requirements.', '2025-08-12 04:41:09', 0),
(4, 1, 'client', 'How do I make a booking?', '2025-08-12 04:41:15', 0),
(5, 1, 'bot', 'To book a bus, you can: 1) Call our reservation line at 1-800-BUS-RENT, 2) Fill out the booking form on our website, or 3) Email your requirements to bookings@busrental.com. We need details like date, time, number of passengers, pickup/dropoff locations, and any special requirements.', '2025-08-12 04:41:15', 0),
(6, 1, 'client', 'How can I contact you?', '2025-08-12 04:41:23', 0),
(7, 1, 'bot', 'You can reach our customer service team by phone at 1-800-BUS-RENT (Monday-Friday, 9AM-5PM EST), by email at support@busrental.com, or through the contact form on our website. For emergencies during an ongoing rental, call our 24/7 support line at 1-888-BUS-HELP.', '2025-08-12 04:41:23', 0),
