(635, 191, 'client', NULL, 'What are your rental rates?', '2025-09-18 02:37:46', 0),
(636, 191, 'bot', NULL, 'Our bus rental pricing varies based on several factors: bus type, duration, distance, and season. Standard buses start at Ôé▒8,000 per day, luxury coaches at Ôé▒12,000 per day. For accurate pricing based on your specific needs, please provide: pickup/drop-off locations, dates, number of passengers, and trip duration.', '2025-09-18 02:37:46', 0),
(637, 191, 'client', NULL, 'How do I make a booking?', '2025-09-18 02:37:49', 0),
