INSERT INTO `testimonials` (`testimonial_id`, `user_id`, `booking_id`, `rating`, `title`, `content`, `is_approved`, `is_featured`, `created_at`, `updated_at`) VALUES
(1, 45, 198, 5, 'So damn good', 'It was a stress-free and enjoyable travel experience. I would definitely recommend this service to anyone looking for reliable and comfortable transportation!', 1, 0, '2025-08-02 03:33:59', '2025-08-30 08:07:51'),
(2, 45, 184, 5, 'It feels like heaven!', 'The driver was professional and courteous, and safety was clearly a priority throughout the trip. I also appreciated the punctuality—we left and arrived exactly on time. There were regular stops for rest and refreshments, and everything was well-organized.', 1, 1, '2025-08-02 04:06:25', '2025-09-06 03:52:36'),
(3, 45, 203, 5, 'Satisfied af', 'I just got back from a trip with [Bus Company Name], and honestly, it was such a smooth ride. The bus was super clean and comfy—plenty of space to stretch out, and the air conditioning actually worked (huge plus!).', 1, 1, '2025-08-02 10:03:33', '2025-09-06 03:52:31'),
(4, 45, 196, 3, 'Very well-mannered driver', 'Our driver was friendly and drove really safely, which made the whole experience feel relaxed. We left right on time and arrived even a little early, which never happens! They also made a couple of nice stops for snacks and bathroom breaks.', 1, 1, '2025-08-02 10:09:50', '2025-09-06 03:52:29'),
(5, 33, 194, 3, 'Need more improvements', 'The trip was generally smooth, and the bus was clean. The driver was professional, and we arrived on time. However, the seats weren’t very comfortable, and the air conditioning was inconsistent. No Wi-Fi or charging ports either. Not bad, but there’s room for improvement.', 1, 1, '2025-08-02 10:13:18', '2025-08-10 11:59:31'),
(6, 47, 174, 4, 'Smooth and Reliable Trip with Minor Flaws', 'I recently traveled with KingLang Transport and had a mostly great experience. The bus was clean and comfortable, the driver was professional, and the trip ran close to schedule. I appreciated the onboard Wi-Fi, although the connection dropped a few times, and one of the seats had a broken recline. Customer service was responsive and helpful, and the pre-departure text updates were a nice touch. Overall, a reliable and pleasant ride with just a few minor areas for improvement—definitely worth 4 stars.', 1, 1, '2025-08-03 16:37:22', '2025-10-01 13:38:31');
